CREATE TABLE productList(
   discount           INTEGER  NOT NULL PRIMARY KEY 
  ,freeShipping       VARCHAR(5) NOT NULL
  ,minPrice           VARCHAR(11) NOT NULL
  ,onClick            VARCHAR(1350) NOT NULL
  ,orders             INTEGER  NOT NULL
  ,oriMinPrice        VARCHAR(12) NOT NULL
  ,productAverageStar NUMERIC(3,1) NOT NULL
  ,productDetailUrl   VARCHAR(1350) NOT NULL
  ,productId          INTEGER  NOT NULL
  ,productImage       VARCHAR(77) NOT NULL
  ,productTitle       VARCHAR(128) NOT NULL
  ,trace              VARCHAR(2639) NOT NULL
  ,widgetId           INTEGER  NOT NULL
  ,widgetOrigin       VARCHAR(3) NOT NULL
);
